WHEN LTRIM(RTRIM(ra.C_Nro_Expediente))='ARIT-ORU-0138/2021' AND ra.N_Codigo_Tipo_Auto=14 AND ra.D_Fecha_Emision=    '2022-03-04 00:00:000' THEN 3540
WHEN LTRIM(RTRIM(ra.C_Nro_Expediente))='ARIT-ORU-0139/2021' AND ra.N_Codigo_Tipo_Auto=4 AND ra.D_Fecha_Emision= '2021-12-30 00:00:000' THEN 3543
WHEN LTRIM(RTRIM(ra.C_Nro_Expediente))='ARIT-ORU-0139/2021' AND ra.N_Codigo_Tipo_Auto=7 AND ra.D_Fecha_Emision= '2022-01-24 00:00:000' THEN 3544
WHEN LTRIM(RTRIM(ra.C_Nro_Expediente))='ARIT-ORU-0139/2021' AND ra.N_Codigo_Tipo_Auto=10 AND ra.D_Fecha_Emision=    '2022-03-25 00:00:000' THEN 3545
WHEN LTRIM(RTRIM(ra.C_Nro_Expediente))='ARIT-ORU-0139/2021' AND ra.N_Codigo_Tipo_Auto=12 AND ra.D_Fecha_Emision=    '2022-04-20 00:00:000' THEN 3546
WHEN LTRIM(RTRIM(ra.C_Nro_Expediente))='ARIT-ORU-0139/2021' AND ra.N_Codigo_Tipo_Auto=14 AND ra.D_Fecha_Emision=    '2022-02-22 00:00:000' THEN 3547
WHEN LTRIM(RTRIM(ra.C_Nro_Expediente))='ARIT-ORU-0140/2021' AND ra.N_Codigo_Tipo_Auto=3 AND ra.D_Fecha_Emision= '2021-12-29 00:00:000' THEN 3550
WHEN LTRIM(RTRIM(ra.C_Nro_Expediente))='ARIT-ORU-0140/2021' AND ra.N_Codigo_Tipo_Auto=4 AND ra.D_Fecha_Emision= '2022-01-07 00:00:000' THEN 3551
WHEN LTRIM(RTRIM(ra.C_Nro_Expediente))='ARIT-ORU-0140/2021' AND ra.N_Codigo_Tipo_Auto=7 AND ra.D_Fecha_Emision= '2022-02-01 00:00:000' THEN 3552
WHEN LTRIM(RTRIM(ra.C_Nro_Expediente))='ARIT-ORU-0140/2021' AND ra.N_Codigo_Tipo_Auto=10 AND ra.D_Fecha_Emision=    '2022-04-01 00:00:000' THEN 3553
WHEN LTRIM(RTRIM(ra.C_Nro_Expediente))='ARIT-ORU-0140/2021' AND ra.N_Codigo_Tipo_Auto=14 AND ra.D_Fecha_Emision=    '2022-03-04 00:00:000' THEN 3554
WHEN LTRIM(RTRIM(ra.C_Nro_Expediente))='ARIT-ORU-0140/2021' AND ra.N_Codigo_Tipo_Auto=29 AND ra.D_Fecha_Emision=    '2022-02-09 00:00:000' THEN 3557
WHEN LTRIM(RTRIM(ra.C_Nro_Expediente))='ARIT-ORU-0141/2021' AND ra.N_Codigo_Tipo_Auto=3 AND ra.D_Fecha_Emision= '2022-01-04 00:00:000' THEN 3558
WHEN LTRIM(RTRIM(ra.C_Nro_Expediente))='ARIT-ORU-0141/2021' AND ra.N_Codigo_Tipo_Auto=4 AND ra.D_Fecha_Emision= '2022-01-11 00:00:000' THEN 3559
WHEN LTRIM(RTRIM(ra.C_Nro_Expediente))='ARIT-ORU-0141/2021' AND ra.N_Codigo_Tipo_Auto=7 AND ra.D_Fecha_Emision= '2022-02-03 00:00:000' THEN 3560
WHEN LTRIM(RTRIM(ra.C_Nro_Expediente))='ARIT-ORU-0141/2021' AND ra.N_Codigo_Tipo_Auto=10 AND ra.D_Fecha_Emision=    '2022-04-08 00:00:000' THEN 3561
WHEN LTRIM(RTRIM(ra.C_Nro_Expediente))='ARIT-ORU-0141/2021' AND ra.N_Codigo_Tipo_Auto=12 AND ra.D_Fecha_Emision=    '2022-05-04 00:00:000' THEN 3562
WHEN LTRIM(RTRIM(ra.C_Nro_Expediente))='ARIT-ORU-0141/2021' AND ra.N_Codigo_Tipo_Auto=14 AND ra.D_Fecha_Emision=    '2022-03-09 00:00:000' THEN 3563
WHEN LTRIM(RTRIM(ra.C_Nro_Expediente))='ARIT-ORU-0141/2021' AND ra.N_Codigo_Tipo_Auto=25 AND ra.D_Fecha_Emision=    '2022-02-24 00:00:000' THEN 3565

    END)                               AS id_actuacion,
       ra.N_Codigo_Destinatario                           AS id_tipo_demandante,
       ra.N_Codigo_Tipo_Not                               AS id_tipo_notificacion,
       D_Fecha_Hora_Notificacion                          AS fecha_hora_notificacion,
       1                                                  AS estado,
       1                                                  AS id_usuario_registra,
       GETDATE()                                          AS fecha_registra,
       NULL                                               AS id_usuario_modifica,
       NULL                                               AS fecha_modifica,
       ra.D_Fecha_Emision                                 AS fecha_actuacion_registro,
       (SELECT CASE
                   WHEN (tra.N_Codigo_Super_Reg IS NULL AND ISNUMERIC(tra.N_Codigo_Intendencia) = 1)
                       THEN tra.N_Codigo_Intendencia + 4
                   WHEN (ISNUMERIC(tra.N_Codigo_Super_Reg) = 1 AND tra.N_Codigo_Intendencia IS NULL)
                       THEN tra.N_Codigo_Super_Reg
                   WHEN (ISNUMERIC(tra.N_Codigo_Super_Reg) = 1 AND ISNUMERIC(tra.N_Codigo_Intendencia) = 1)
                       THEN tra.N_Codigo_Super_Reg
                   END
        FROM TSS_RECURSOS_ALZADA AS TRA
        WHERE TRA.C_Nro_Expediente = ra.C_Nro_Expediente) AS id_region_radicatoria
FROM TSS_NOTIFICACIONES AS ra
WHERE (ra.C_Nro_Expediente LIKE 'ARIT-ORU-%/2021%' OR ra.C_Nro_Expediente LIKE 'ARIT-ORU-%/2022%')
  AND ra.N_Codigo_Tipo_Auto NOT IN (22, 23)
ORDER BY ra.C_Nro_Expediente;